(SELECT COUNT(id) FROM comments WHERE post_id = p.id) AS comment_count,p.post_type_id,
IFNULL((SELECT vs.up_vote FROM votes vs where vs.post_based_id = p.id and vs.up_vote = \'46\' order by vs.id limit 1),0) as up_vote_user_id,
IFNULL((SELECT vs1.down_vote FROM votes vs1 where vs1.post_based_id = p.id and vs1.down_vote = \'46\' order by vs1.id limit 1),0) as down_vote_user_id 
FROM 
	posts p
    INNER JOIN users u on u.id = p.user_id
     
	
where
    p.user_id = u.id
	
    AND p.del_status = 1
    
    
	
	
    AND NOT FIND_IN_SET(\'46\',p.hide) <> 0
    ORDER BY up_vote_count DESC LIMIT 0, 9'
