IFNULL((SELECT vs1.down_vote FROM votes vs1 where vs1.post_based_id = p.id and vs1.down_vote = \'46\' order by vs1.id limit 1),0) as down_vote_user_id 
FROM 
	posts p
    INNER JOIN users u on u.id = p.user_id
     
	
where
    p.user_id = u.id
	
    AND p.del_status = 1
    
    
	
	
    AND NOT FIND_IN_SET(\'46\',p.hide) <> 0
    ORDER BY p.id DESC LIMIT 0, 9'
